  },
  getItemDetail: {
    method: 'get',
    url: `/activiti/bizItem/get`
  },
  getItemList: {
    method: 'get',
    url: `/activiti/bizItem/find`
  },
  saveItem: {
    method: 'post',
    url: `/activiti/bizItem/save`
  },

  //任务
  updateAssignee: {
    method: 'get',
    url: `/activiti/task/updateAssignee`
  },
  getReadyTaskByInst: {
    method: 'get',
    url: `/activiti/task/getReadyTaskByInst`
  },
}

